export class Twimp {
  constructor(id, url, author, content, timestamp) {
    this._id = id;
    this._url = url;
    this._author = author;
    this._content = content;
    this._timestamp = timestamp;
    this._favorite = false;
  }
  get id() {
    return this._id;
  }
  get url() {
    return this._url;
  }
  get author() {
    return this._author;
  }
  get content() {
    return this._content;
  }
  get timestamp() {
    return this._timestamp;
  }
  get favorite() {
    return this._favorite;
  }
  set id(id) {
    this._id = id;
  }
  set url(url) {
    this._url = url;
  }
  set author(author) {
    this._author = author;
  }
  set content(content) {
    this._content = content;
  }
  set timestamp(timestamp) {
    this._timestamp = timestamp;
  }
  set favorite(favorite) {
    this._favorite = favorite;
  }
}
